/*
This is a text for voxel octree ray traversal
inpired from:
https://lsi2.ugr.es/curena/inves/wscg00/revelles-wscg00.pdf

be aware that this is NOT good code, some things should not be used like that


the main limitation that is slowing down the render is the data stored in buffers.

by using custom textures with the data i could use a way more detail voxel model 
but without custom textures, shaders limit the number of variables to 4096
so i could not store more data.
by the way if some one know how to pass custom textures in shadertoy like this
shader 'https://www.shadertoy.com/view/lsGGDd' but with RGBA float32 textures ?
I have my idea on how i could bypass this problem, so i will probably try it later,
with more complex voxels!

the tree is stored as:
Node:
    8 uint for each child

    and for each uint (32 bit)
        24 bit -> child index
        6 bit -> material index
        1 bit -> is the leaf empty
        1 bit -> is the node a leaf

if you want to see the octree, you can uncomment line 34

*/


//#define showTree

#define maxDepth 10

int actualDepth = 0;
uint nodeIdx[maxDepth];
uint childIdx[maxDepth];
vec3 t0s[maxDepth];
vec3 t1s[maxDepth];
vec3 treeUp = vec3(2.0);
vec3 treeDown = vec3(-2.0);

struct Mat{float Ns; vec3 Kd, Ks, Ke; int id;};
const Mat materials[4] = Mat[](
    Mat(80.740713, 1.6*vec3(0.056215, 0.045614, 0.076713), vec3(0.585106, 0.585106, 0.585106), vec3(0.000000, 0.000000, 0.000000), 0),
    Mat( 20.918504, vec3(0.305978, 0.096844, 0.049981), 0.2*vec3(0.574468, 0.574468, 0.574468), vec3(0.000000, 0.000000, 0.000000), 1),
    Mat( 20.918504, vec3(0.452223, 0.171584, 0.080988), 0.2*vec3(0.574468, 0.574468, 0.574468), vec3(0.000000, 0.000000, 0.000000), 2),
    Mat( 20.995129, vec3(0.557894, 0.199709, 0.071449), 0.2*vec3(0.627660, 0.627660, 0.627660), vec3(0.000000, 0.000000, 0.000000), 3)
);

vec3 normal;
Mat material;
vec3 col = vec3(0.0);

#define vec4ToUint (uint(data.x) + (uint(data.y)<<8) + (uint(data.z)<<16) + (uint(data.w)<<24))
uint treeTex(uint idx){
    vec4 data;
    ivec2 co;
    if(idx < 3818u){
        data = texelFetch(iChannel0, ivec2(idx % 64u, idx / 64u), 0);
        return vec4ToUint;
    }
    idx -= 3818u;
    if(idx < 3818u){
        data = texelFetch(iChannel1, ivec2(idx % 64u, idx / 64u), 0);
        return vec4ToUint;
    }
    idx -= 3818u;
    if(idx < 3818u){
        data = texelFetch(iChannel2, ivec2(idx % 64u, idx / 64u), 0);
        return vec4ToUint;
    }
    idx -= 3818u;
    if(idx < 3818u){
        data = texelFetch(iChannel3, ivec2(idx % 64u, idx / 64u), 0);
        return vec4ToUint;
    }
    return 0u;
}

float rand(vec3 p){
    uint idx = uint(p.x) + uint(p.y)*64u + uint(p.z)*64u*64u;
    idx ^= 3646844786u;
    idx *= 474746u;
    idx >>= 16;
    idx *= 563563u;
    idx >> 13;
    idx *= 454749u;
    return float(idx)/4294967295.0;
}

//tree traversal stuff

uint a;
uint find_firstNode(vec3 t0, vec3 tM){
    uint first = 0u;
    if(t0.x > t0.y && t0.x > t0.z){ // entry YZ
        if(tM.y < t0.x) first |= 2u;
        if(tM.z < t0.x) first |= 1u;
    }else if(t0.y > t0.z){ // entry XZ
        if(tM.x < t0.y) first |= 4u;
        if(tM.z < t0.y) first |= 1u;
    }else{  // entry XY
        if(tM.x < t0.z) first |= 4u;
        if(tM.y < t0.z) first |= 2u; 
    }
    return first;
}

uint next_Node(vec3 t1, uint yz, uint xz,uint xy){
    if(t1.x < t1.y && t1.x < t1.z){
        return yz;
    }else if(t1.y < t1.z){
        return xz;
    }else{
        return xy;
    }
}

float procTree( vec3 t0, vec3 t1, bool shadow)
{   
    actualDepth = 0;
    t0s[actualDepth] = t0;
    t1s[actualDepth] = t1;
    const int END = 8;

    vec3 tM = 0.5 * (t0 + t1);
    childIdx[actualDepth] = find_firstNode(t0, tM);
    nodeIdx[actualDepth] = 0u;
    nodeIdx[actualDepth + 1] = treeTex(nodeIdx[actualDepth] + a ^ childIdx[actualDepth]);
    //nodeIdx[actualDepth + 1] = tree[nodeIdx[actualDepth] + a ^ childIdx[actualDepth]];

    if (0x10u == 10u){
    return 0.0;
    }

    for(int i = 0; i < 130; i ++){
        if (actualDepth < 0)return -1.0;//visited all nodes

        uint currNode =  childIdx[actualDepth];

        if(currNode == 8u){
            actualDepth -= 1;
            t0 = t0s[actualDepth];
            t1 = t1s[actualDepth];
            tM = 0.5 * (t0 + t1);
            currNode = childIdx[actualDepth];
            vec3 dt = t1 - t0;
            vec3 idx = vec3(float(currNode&4u)/4.0, float(currNode&2u)/2.0, float(currNode&1u));
            vec3 t0_ = t0 + 0.5*dt*idx;
            vec3 t1_ = t0 + 0.5*dt*(1.0 + idx);
            vec3 tM_ = 0.5*(t0_ + t1_);

            uvec3 next = uvec3[](uvec3( 4 , 2 , 1 ),
                             uvec3( 5 , 3 ,END),
                             uvec3( 6 ,END, 3 ),
                             uvec3( 7 ,END,END),
                             uvec3(END, 6 , 5 ),
                             uvec3(END, 7 ,END),
                             uvec3(END,END, 7 ),
                             uvec3(END,END,END))[currNode];

            childIdx[actualDepth] = next_Node(t1_, next.x, next.y, next.z);
            //nodeIdx[actualDepth + 1] = tree[(nodeIdx[actualDepth]>>1u) + a ^ childIdx[actualDepth]];
            nodeIdx[actualDepth + 1] = treeTex((nodeIdx[actualDepth]>>8u) + a ^ childIdx[actualDepth]);
            continue;
        }

        if (actualDepth == 7){col = vec3(1.0, 0.0, 0.0); return -1.0;}


        //bool leaf = actualDepth == 6 || ((childIdx[actualDepth]^a) != 0u && (childIdx[actualDepth]^a) != 7u);
        bool leaf = ((nodeIdx[actualDepth + 1] & 1u) == 1u) || actualDepth==8;

        if (leaf){
            t0 = t0s[actualDepth];
            t1 = t1s[actualDepth];
            tM = 0.5 * (t0 + t1);
            currNode = childIdx[actualDepth];
            vec3 dt = t1 - t0;
            vec3 idx = vec3(float(currNode&4u)/4.0, float(currNode&2u)/2.0, float(currNode&1u));
            vec3 t0_ = t0 + 0.5*dt*idx;
            vec3 t1_ = t0 + 0.5*dt*(1.0 + idx);
            vec3 tM_ = 0.5*(t0_ + t1_);


            uint data = nodeIdx[actualDepth + 1] >> 1u;
            if ((data & 1u) == 1u){ //the node is full
                t0 = t0_;
                if (shadow) return max(max(t0.x, t0.y), t0.z);
                data >>= 1u;
                material = materials[data & 7u];

                if(t0.x > t0.y && t0.x > t0.z){ // entry YZ
                    normal = vec3(1.0, 0.0, 0.0);
                    return t0.x;
                }else if(t0.y > t0.z){ // entry XZ
                    normal = vec3(0.0, 1.0, 0.0);
                    return t0.y;
                }else{  // entry XY
                    normal = vec3(0.0, 0.0, 1.0);
                    return t0.z;
                }
            }//the node is empty
            #ifdef showTree   
            col -= 0.012*float(actualDepth); 
            #endif

            uvec3 next = uvec3[](uvec3( 4 , 2 , 1 ),
                             uvec3( 5 , 3 ,END),
                             uvec3( 6 ,END, 3 ),
                             uvec3( 7 ,END,END),
                             uvec3(END, 6 , 5 ),
                             uvec3(END, 7 ,END),
                             uvec3(END,END, 7 ),
                             uvec3(END,END,END))[currNode];

            childIdx[actualDepth] = next_Node(t1_, next.x, next.y, next.z);
            //nodeIdx[actualDepth + 1] = tree[(nodeIdx[actualDepth]>>1u) + a ^ childIdx[actualDepth]];
            nodeIdx[actualDepth + 1] = treeTex((nodeIdx[actualDepth]>>8u) + a ^ childIdx[actualDepth]);

        } else {
            t0 = t0s[actualDepth];
            t1 = t1s[actualDepth];
            actualDepth += 1;

            tM = 0.5 * (t0 + t1);

            vec3 dt = t1 - t0;
            vec3 idx = vec3(float(currNode&4u)/4.0, float(currNode&2u)/2.0, float(currNode&1u));
            vec3 t0_ = t0 + 0.5*dt*idx;
            vec3 t1_ = t0 + 0.5*dt*(1.0 + idx);
            vec3 tM_ = 0.5*(t0_ + t1_);
            childIdx[actualDepth] = find_firstNode(t0_, tM_);
            //nodeIdx[actualDepth + 1] = tree[(nodeIdx[actualDepth]>>1u) + a ^ childIdx[actualDepth]];
            nodeIdx[actualDepth + 1] = treeTex((nodeIdx[actualDepth]>>8u) + a ^ childIdx[actualDepth]);
            t0s[actualDepth] = t0_;
            t1s[actualDepth] = t1_;
        }

    }
    return -1.0;
}



float ray_step(vec3 ro, vec3 rd, bool shadow){
    a = 0u;
    vec3 size = (treeUp + treeDown)*0.5;
    ro.z = size.z - ro.z;
    rd.z = -(rd.z);

    if (rd.x < 0.0){
        ro.x = size.x - ro.x;
        rd.x = -rd.x;
        a |= 4u;
    }
    if (rd.y < 0.0){
        ro.y = size.y - ro.y;
        rd.y = -rd.y;
        a |= 2u;
    }
    if (rd.z < 0.0){
        ro.z = size.z - ro.z;
        rd.z = -(rd.z);
        a |= 1u;
    }

    vec3 invDir = 1.0/rd;
    vec3 t0 = (treeDown - ro) * invDir;
    vec3 t1 = (treeUp - ro) * invDir;

    float tmin = max(max(t0.x, t0.y), t0.z);
    float tmax = min(min(t1.x, t1.y), t1.z);
    if ((tmin < tmax) && (tmax > 0.0f)){
        return procTree(t0, t1, shadow);
    }else{ //doesn't intersect
        return -1.0;
    }
}

void mainImage( out vec4 fragColor, in vec2 fragCoord ){
    vec2 uv = fragCoord/iResolution.xy*2.0 - 1.0;
    uv.x *= iResolution.x/iResolution.y;

    vec3 camPos = vec3(-3.0*cos(iTime), 0.5 + 0.4*sin(iTime*0.7), -3.0*sin(iTime))*0.8;
    vec3 target = vec3(0.0);
    const vec3 lightPos = vec3(4.0, 2.0, -2.5)*10.0;

    vec3 dir0 = normalize(target - camPos);
    vec3 up = vec3(0.0, 1.0, 0.0);
    vec3 right = normalize(cross(up, dir0));
         up = cross(dir0, right);

    vec3 rd = normalize(right * uv.x + up * uv.y + dir0);

    float t = ray_step(camPos, rd, false);
    //back ground
    vec3 col2 = 0.5*vec3(135.0/255.0, 206.0/255.0, 235.0/255.0);
    col2 += 0.1*(1.0 - pow(abs(rd.y)+0.01, 0.2)); 
    vec3 camLight = normalize(lightPos - camPos);
    col2 += 0.05*(0.5 + 0.5*dot(rd, camLight));
    col2 += 0.05*pow(0.5 + 0.5*dot(rd, camLight), 10.0);

    if (t > 0.0){
        vec3 p = camPos + t*rd;
        vec3 voxCoord = floor((p+2.0)*16.0 - vec3(0.00001, 0.00001, 0.00001));
        // material texture variation
        material.Kd *= 0.95 + 0.1*rand(voxCoord);
        material.Kd.r *= 0.95 + 0.6*rand(abs(voxCoord - 56.0));
        if(material.id == 0)material.Kd.b *= 0.95 + 0.3*rand(abs(voxCoord - 36.0));
        if(material.id == 1)material.Kd *= 0.8 + 0.5*fract(sin(floor((voxCoord - 3.0)/6.0)*39.0)*45.0);
        //lighting
        col2 = material.Kd;
        normal *= -sign(rd);

        const vec3 lightPos = vec3(4.0, 2.0, -2.5)*10.0;
        vec3 lightDir = normalize(lightPos - p);
        //ambiant
        float AO = 0.9;
        AO *= 0.3 + 0.7*smoothstep(0.0, 0.7, max(max(abs(p.x*0.8), max(0.0, p.y)), abs(p.z)));
        col2 = material.Kd * AO * vec3(0.2, 0.8, 0.9);

        //shadow
        float shadow = ray_step(lightPos, - lightDir, true);
        if (shadow > 0.0){
            vec3 p2 = lightPos - lightDir * shadow;
            shadow = 1.0 - 0.95*step(0.00001, dot(p-p2, p-p2));
        }else{shadow = 1.0;};

        normal = mix(normal, 2.0*vec3(rand(abs(p)*60.0), rand(abs(p)*60.0 + 10.0), rand(abs(p)*60.0 + 20.0)) - 1.0, 0.02);
        //diffuse
        col2 += shadow * material.Kd * max(0.0, dot(normal, lightDir));
        //specular
        vec3 r = reflect(rd, normal);
        col2 += shadow * material.Ks * pow(max(0.0,dot(r, lightDir)), material.Ns);

    }
    uv = fragCoord/iResolution.xy;

    // color stuff
    //col2 = pow( col2, vec3(0.4545) );
    col2 = 1.0 - exp(-col2*3.2);
    col2 = clamp(col2, 0.0, 1.0);
    col2 = col2*col2*(3.0-2.0*col2);

    col2 *= vec3(1.2, 1.2, 1.0);

    col2 *= 0.6 + 0.4*pow(16.0*uv.x*uv.y*(1.0-uv.x)*(1.0-uv.y), 0.4 );
    fragColor = vec4(col + col2,1.0);
}
